import React from 'react';
import './sidenav.css';
import dashboardicon from './cityscape.png';
import pipelineicon from './deal.png';

const SideNav = () => {
	return (
		<nav className="sidebar">
			<img src={ dashboardicon } className="navicon" alt="Dashboard" />
			<p className="navtext">Dashboard</p>
			<img src={ pipelineicon } className="navicon2" alt="Pipeline" />
			<p className="navtext">Pipeline</p>
		</nav>
	);
}

export default SideNav;
